Mañana es la Posada Experience en Ft. Lauderdale, prepárense para recrear esta festividad decembrina llena de cultura, colores y sabores.

Estaremos participando con Oh.MyConcha a la distancia hablando de cómo celebramos la Novena en México 🇲🇽.

Los vendors que le pondrán sabor a la fiesta serán:
@simplebyrosy con deliciosos postes keto, vegan & gluten free 🧁.
@rvsflowers.fl llevando los arreglos florales mas lindos de temporada 💐.
@belly_heaven con unos exquisitos tacos 🌮.
@mitienditabygaby con delicias gourmet y artesanías mexicanas.
@superking_usa presentará una colección de work out clothing, ideal para cumplir el propósito de año nuevo: hacer ejercicio 🏃‍♂️🏃‍♀️.

Ahora si, listos para pedir posada, tomar ponche (con o sin piquete), partir la Piñata, pasar una tarde familiar llena de sabores y tradiciones.

*Como parte de las actividades creativas estarán el crear tu propia piñata, pintar sobre canvas y un performance Aerial Circus con la artista @daniela_cirque 🎪.

Nos vemos mañana de 5 a 8 pm en ⤵️
241 East Commercial Boulevard Fort Lauderdale, FL 33334.

